    this.initFlag = '';
    this.service.tabsArr.subscribe(data => {
      if (data) {
        this.tabsArr = data;
        this.clickHide();
      }
    });
    this.service.loginUserID.subscribe(loginUserID => {
      this.loginUserID = loginUserID;
    });
  }

  ngOnInit() {
    this.getFD_HL_RequestNoDetails();
    this.getEngineFamily();
  }

  getEngineFamily() {
    let dataObj = {
      ENGINE_M_REF_ID: ''
    };
    this.service.invokeService("GetFDHLEngineFamilyDetails", dataObj, this.namespace, true, false).then(res => {
      res.forEach(data => {
        this.ENGINE_FAMILY_NO_Arr.push({
          RefNo: data.ENGINE_F_REF_ID,
          engineFamilyNo: data.ENGINE_FAMILY_NO
        });
      });
    });
  }

  dashboardView() {
    if (this.tabsArr.includes('ViewDashboard') && this.tabsArr.includes('Dashboard')) {
      return true;
    }

    if (this.tabsArr.includes('Dashboard')) {
      return true;
    }

    if (this.tabsArr.includes('ViewDashboard')) {
      return false;
    }

    return false;
  }

  clickHide() {
    if (this.tabsArr.includes('ViewDashboard') && this.tabsArr.includes('Dashboard')) {
      this.isDash_ViewDashbrd = true;
    }

    if (this.tabsArr.includes('Dashboard')) {
      this.isDashboard = true;
    }

    if (this.tabsArr.includes('ViewDashboard')) {
      this.isViewDashbrd = true;
    }
  }

  mailTrigger(HR_REF_NO) {
    this.call_modal = false;
    let dObj = {
      HR_REF_NO: HR_REF_NO,
      userId: this.loginUserID,
      fromUser: this.loginUserID
    };
    this.service.invokeService("SendFDHLDocumentDetailsByHr_Ref_No", dObj, this.namespace, true, false).then(res => {
      setTimeout(() => {
        this.call_modal = true;
        this.data_send = {
          text: 'Mail triggered successfully',
          active: this.call_modal
        };
      }, 0);
    });
  }

  workflowHistory() {
    this.AAHPopup = 'block';
    const body = document.querySelector("body");
    body.style.overflow = "hidden";
  }

  closeWorkFlowDoc() {
    this.AAHPopup = 'none';
    const body = document.querySelector("body");
    body.style.overflow = "auto";
  }

  getAAH(arg, event) {
    if (this.previndex) {
      this.previndex.target.checked = false;
    }

    this.previndex = event;

    if (!event.target.checked) {
      arg = '';
      this.previndex = undefined;
    }

    let dataObj = {
      HR_RefNo: arg
    };
    this.service.invokeService("GetFD_HLHistoryDetailsByHR_RefNo", dataObj, this.namespace, true, false).then(res => {
