    this.reqIdFlag = 'selected';
  }

  selectEventInitiator(item) {
    this.initiator = item.INITIATOR_ID; // this.initiator1 = item.INITIATOR_ID;

    this.initFlag = 'selected';
  }

  clearReqID() {
    this.requestIDStr1 = '';
    this.searchObj.requestIDStr = '';
  }

  clearInitiator() {
    this.initiator1 = '';
    this.initiator = '';
  }

  getEngineModel() {
    this.engineModel = [];
    let obj = {
      ENGINE_FAMILY_NO: this.searchObj.engineNumber
    };
    this.service.invokeService("GetFDHLEngineModelsByFamily", obj, this.namespace, true, false).then(res => {
      res.forEach(d => {
        this.engineModel.push(d.ENGINE_MODEL_NO);
      });
    });
  }

  handlePageChange(eve) {
    this.pagination.currentPage = eve;
  }

  clear() {
    this.searchObj = {
      engineNumber: '',
      engineModel: '',
      status: '',
      stage: '',
      requestIDStr: '',
      fromDate: '',
      toDate: '',
      type: '',
      location: ''
    };
    this.initiator1 = '';
    this.initiator = '';
    this.requestIDStr1 = '';
    this.searchedData = [];
    this.engineModel = [];
  }

