          setTimeout(() => {
            _this.call_modal = true;
            _this.data_send = {
              text: 'To Date Should be less than From Date',
              active: _this.call_modal
            };
            _this.searchObj.toDate = '';
          }, 0);
          return;
        }
      }
    })();
  }

  clickToView(HR_REF_NO) {
    this.router.navigate(['/createNewRequest'], {
      queryParams: {
        HR_REF_NO: HR_REF_NO,
        openAs: "dashboard"
      }
    });
