            active: this.call_modal
          };
        }, 0);
      }

      this.searchedData = res;
    });
  }

  getFD_HL_RequestNoDetails() {
    this.service.invokeService("GetFD_HL_RequestNoDetails", null, this.namespace, true, false).then(res => {
